import logo from './logo.svg';
import React, { useState } from 'react';
import './App.css';

function App() {
  const [isSignedIn, setIsSignedIn] = useState(false);
  return (
    <div className='App'>
      <p>You are not signed in. Click here to sign in.</p>
      <button id='loginButton'>Login with Google</button>
    </div>
  );
}

export default App;
